def extract_gender_feature(image_number):
    # Construct the URL for the JSON file based on the image number
    json_url = f"https://github.com/DCGM/ffhq-features-dataset/raw/master/json/{image_number}.json"
    try:
        # Download the JSON file
        response = requests.get(json_url)
        response.raise_for_status()  # Raise an exception for any HTTP error

        # Load JSON data
        json_data = response.json()
        if(len(json_data)>0):
        # print(json_data)
        # Extract gender feature
            gender = json_data[0]["faceAttributes"]["gender"]
        
            return gender
    
    except requests.exceptions.RequestException as e:
        print(f"Error fetching data: {e}")
        return None

