def print_files_in_directory(directory):
    try:
        # Iterate over the files in the directory
        for filename in tqdm(os.listdir(directory), desc='Extracting'):
            if os.path.isfile(os.path.join(directory, filename)):
                image_number = filename.split('.jpg')[0]
                if image_number not in z:  # Check if image number is not in list z
                    gender_feature = extract_gender_feature(image_number)
                    if gender_feature is not None:
                        output_file = "output.csv"
                        with open(output_file, 'a', newline='') as csvfile:
                            csv_writer = csv.writer(csvfile)
                            if csvfile.tell() == 0:
                                csv_writer.writerow(['Filename', 'Gender'])
                            csv_writer.writerow([image_number, gender_feature])
                    else:
                        print(f"Failed to extract the gender feature for image {image_number}.jpg")
                        os.remove(os.path.join(directory, filename))
                else:
                    print(f"Skipping file {filename} as it's in the exclusion list.")
    except OSError as e:
        print(f"Error: {e}")

